CREATE TABLE IF NOT EXISTS `Amazon_Sales_Cleaned_Final` (
    `Sl_No` INT,
    `Region` VARCHAR(33) CHARACTER SET utf8,
    `Country` VARCHAR(32) CHARACTER SET utf8,
    `Item_Type` VARCHAR(15) CHARACTER SET utf8,
    `Sales_Channel` VARCHAR(7) CHARACTER SET utf8,
    `Order_Priority` VARCHAR(1) CHARACTER SET utf8,
    `Order_Date` DATETIME,
    `Order_ID` INT,
    `Ship_Date` DATETIME,
    `Units_Sold` INT,
    `Unit_Price` NUMERIC(5, 2),
    `Unit_Cost` NUMERIC(5, 2),
    `Total_Revenue` NUMERIC(9, 2),
    `Total_Cost` NUMERIC(9, 2),
    `Total_Profit` NUMERIC(9, 2)
);
